import React from 'react';
import { Grid, Paper, List, ListItem, ListItemText  } from '@material-ui/core'
import IconButton from '@material-ui/core/IconButton'
import './InformationPage.css';



export default function InformationPage() {
  return (
    <div >
      <h1 style={{margin: "3%", fontStyle: "normal", fontWeight: "400", fontSize: "36px"}}>WA Legal Inforamtion</h1>
      <Grid container spacing={0}>          
        <Grid item xs={12} sm={4} className="Info" style={{marginBottom: "50px"}}>
            <a href={member.linkedin} target="_blank">
              <IconButton variant="link" color="primary" component="span" >
                <LinkedInIcon style={{fontSize: "30px"}}/>
              </IconButton>
            </a>
        </Grid>
      </Grid>
    </div>

  );
}
